const token = 'eyJhbGciOiJIUzI1NiJ9.eyJhdWQiOm51bGwsImlzcyI6IlZwaHBaakx1UVl1ZUR1VkViT2Z4VnciLCJleHAiOjE2Mzk2ODQ5OTAsImlhdCI6MTYzOTY3OTU5Mn0.GPdNVXRUSo0ZpXHNRvFMq2FYbCqc_qJLxDnyoCRgT20';
const url = 'https://api.zoom.us/v2/users/me/meetings';
export const exampleData = {
    topic: 'EjemploReu2',
    type: 2,
    start_time: '2022-02-28T18:00:10',
    duration: '45',
    settings: {
        host_video: true,
        participant_video: true,
        join_before_host: true,
        mute_upon_entry: 'true',
        watermark: 'false',
        audio: 'voip',
        auto_recording: 'cloud',
    },
};
export async function getData() {
    const res = await fetch(url, {
        method: 'GET',
        mode: 'no-cors',
        headers: {
            Authorization: `Bearer ${token}`,
        },
    });
    return res.json();
}
export async function postData(data = {}) {
    const res = await fetch(url, {
        method: 'POST',
        mode: 'cors',
        cache: 'no-cache',
        credentials: 'same-origin',
        headers: {
            Authorization: `Bearer ${token}`,
            'Content-Type': 'application/json',
        },
        redirect: 'follow',
        referrerPolicy: 'no-referrer',
        body: JSON.stringify(data),
    });
    return res.json();
}
